import React, {useNavigate, useState } from "react";
import citiesOfCroatia from "../citiesOfCroatia.json";
import translations from "../translations";

function Form() {
  const [acceptGDPR, setAcceptGDPR] = useState(false);
  const [showCities, setShowCities] = useState(false);
  const [language, setLanguage] = useState("en");
  const [persons, setPersons] = useState([]);
  const navigate = useNavigate();

  const addPerson = () => ({
    firstName: "",
    lastName: "",
    gender: "",
    dateOfBirth: "",
    citizenship: "",
    birthCountry: "",
    countryResidence: "",
    residencePlace: "",
    documentType: "",
    documentNumber: "",
  });

  const [formData, setFormData] = useState([addNewPerson()])
  const handleFirstNameChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].firstName = event.target.value;
    setPersons(newPerson);
  };

  const handleLastNameChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].lastName = event.target.value;
    setPersons(newPerson);
  };

  const handleGenderChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].gender = event.target.value;
    setPersons(newPerson);
  };

  const handleDateInput = (input) => {
    if (input.length === 2 || input.length === 5) {
      return input + ".";
    }
    return input;
  };

  const currentYear = new Date().getFullYear();
  const isValidDate = (day, month, year) => {
    return day <= 31 && month <= 12 && year <= currentYear;
  };

  const handleDateOfBirthChange = (index, event) => {
    const newPerson = [...persons];
    const { value } = event.target;
    const onlyNums = value.replace(/[^0-9]/g, "");

    if (onlyNums.length <= 8) {
      let day = onlyNums.slice(0, 2);
      let month = onlyNums.slice(2, 4);
      let year = onlyNums.slice(4);
      if (isValidDate(day, month, year)) {
        let formattedInput =
          handleDateInput(day) + handleDateInput(month) + year;
          newPerson[index].dateOfBirth = formattedInput; 
      }
    }
    setPersons(newPerson);
  };

  const handleCitizenshipChange = (index, event) => {
    const newPerson = [...persons];
    const value = event.target.value;
    newPerson[index].citizenship = value;
    if (value === "Croatia") {
      newPerson[index].birthCountry = "Croatia";
      newPerson[index].countryResidence = "Croatia";
      setShowCities(true);
    } else {
      newPerson[index].birthCountry = value;
      newPerson[index].countryResidence = value;
      setShowCities(false);
    }
  };

  const handleBirthCountryChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].birthCountry = event.target.value;
    setPersons(newPerson);
  };

  const handleCountryResidenceChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].countryResidence = event.target.value;
    setPersons(newPerson);
    setShowCities(event.target.value === "Croatia");
  };

  const handleResidencePlaceChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].residencePlace = event.target.value;
    setPersons(newPerson);
  };

  const handleDocumentTypeChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].documentType = event.target.value;
    setPersons(newPerson);
  };

  const handleDocumentNumberChange = (index, event) => {
    const newPerson = [...persons];
    newPerson[index].documentNumber = event.target.value;
    setPersons(newPerson);
  };

  const handleGDPRCheckbox = (event) => {
    setAcceptGDPR(event.target.checked);
  };

  const [triedToSubmit, setTriedToSubmit] = useState(false);
  const validateForm = () => {
    for (const person of persons) {
      if (
        !person.firstName ||
        !person.lastName ||
        !person.gender ||
        !person.dateOfBirth ||
        !person.citizenship ||
        !person.birthCountry ||
        !person.countryResidence ||
        !person.residencePlace ||
        !person.documentType ||
        !person.documentNumber
      ) {
        alert("Please, enter all required information.");
        setTriedToSubmit(true);
        return false;
      }

      const datePattern = /^\d{2}\.\d{2}\.\d{4}$/;
      if (!datePattern.test(person.dateOfBirth)) {
        alert("Please enter a valid date in the format dd.MM.yyyy");
        return false;
      }
    }

    if (!acceptGDPR) {
      alert("Please accept the GDPR and privacy policy");
      return false;
    }
    return true;
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log("handleSubmit called");
    if (validateForm()) {
      console.log("Form submitted");
      setTriedToSubmit(true);
      return false;
    }
  };

  const getValidationStyle = (value) => {
    return {
      borderColor: triedToSubmit && !value ? "red" : "initial",
    };
  };

  const changeLanguage = (lang) => {
    setLanguage(lang);
    navigate(`/${lang}`);
  };


  return (
    <div className="container body-container">
      <div className="select-language">
        <img
          src="/images/german.png"
          alt="german"
          className="german-img"
          onClick={() => changeLanguage("de")}
        ></img>
        <img
          src="/images/italian.png"
          alt="italian"
          className="italian-img"
          onClick={() => changeLanguage("it")}
        ></img>
        <img
          src="/images/english.png"
          alt="english"
          className="english-img"
          onClick={() => changeLanguage("en")}
        ></img>
      </div>
      <div className="form-container">
        <form method="POST" onSubmit={handleSubmit}>
        {persons.map((person, index) => (
    <div className="form-fields" key={index}>
            <div className="form-field">
                <label
                  htmlFor="firstName"
                  style={{ fontSize: "23px", marginBottom: "5px" }}
                >
                  <u>{translations[language].firstPerson}</u>
                </label>
              </div>
              <div className="form-field">
                <label htmlFor="firstName">
                  {translations[language].firstName}
                </label>
                <br />
                <input
                  type="text"
                  id={`firstName-${index}`}
                  name="firstName"
                  maxLength={100}
                  value={person.firstName}
                  onChange={(e) => handleFirstNameChange(index, e)}
                  style={getValidationStyle(person.firstName)}
                />
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="lastName">
                  {translations[language].lastName}
                </label>
                <br />
                <input
                  type="text"
                  id="lastName"
                  name="lastName"
                  maxLength={100}
                  value={person.lastName}
                  onChange={(e) => handleLastNameChange(index, e)}
                  style={getValidationStyle(person.lastName)}
                />
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="gender">{translations[language].gender}</label>
                <br />
                <select
                  name="gender"
                  id="gender"
                  value={person.gender}
                  onChange={(e) => handleGenderChange(index, e)}
                >
                  <option value="male">Male</option>
                  <option value="female">Female</option>
                </select>
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="dateOfBirth">
                  {translations[language].dateOfBirth}{" "}
                </label>
                <br />
                <input
                  type="text"
                  id="dateOfBirth"
                  name="dateOfBirth"
                  placeholder="dd.MM.yyyy"
                  value={person.dateOfBirth}
                  onChange={(e) => handleDateOfBirthChange(index, e)}
                  maxLength={10}
                />
                <br />
              </div>
              <div className="form-field">
                <label htmlFor="citizenship">
                  {" "}
                  {translations[language].citizenship}{" "}
                </label>
                <br />
                <input
                  type="text"
                  id="citizenship"
                  name="citizenship"
                  list="countries"
                  value={person.citizenship}
                  onChange={(e) => handleCitizenshipChange(index, e)}
