                <label htmlFor="countryResidence">
                  {translations[language].countryResidence}
                </label>
                <br />
                <input
                  name="countryResidence"
                  type="text"
                  id="countryResidence"
                  list="countries"
                  value={person.countryResidence}
                  onChange={(e) => handleCountryResidenceChange(index, e)}
                />
