                  name="residencePlace"
                  type="text"
                  id="residencePlace"
                  maxLength={50}
                  value={person.residencePlace}
                  onChange={(e) => handleResidencePlaceChange(index, e)}
                  list={showCities ? "cities" : ""}
                />
                <datalist id="cities">
                  {citiesOfCroatia.map((city, index) => (
                    <option key={index} value={city.city} />
                  ))}
                </datalist>
              </div>
