                  name="documentNumber"
                  type="text"
                  id="documentNumber"
                  maxLength={16}
                  value={person.documentNumber}
                  onChange={(e) => handleDocumentNumberChange(index, e)}
                  style={getValidationStyle(person.documentNumber)}
                />
                <br />
              </div>
